Основные требованияВерстальщик должен приступать к работе над проектом только после инвистегейта имплементатора.В инвистегейте должны быть расписаны все элементы страниц (post, widtet-text и т.д.). Имплементатор должен стараться избегать использования специфических англоязычных сокращений или терминов, его инвистегейт должен быть понятен верстальщику не имеющему больших знаний в WP. Верстальщик в соответствии с инвистегейтом должен использовать подходящий html код для элементов/блоков/виджетов страницы.

CSS свойства элементов находящихся в контентной части (пост, список постов, форма комментариев, список комментариев и т.д.) нужно прописывать глобально, а CSS свойства внутренних элементов виджетов (списки, ссылки, параграфы, формы и т.д.) должны прописываться относительно виджета или сайдбара, в случае если эти стили отличаются.
Основные правила для виджетов:

текстовый виджет — может содержать любой html код;

динамический виджет — это стандартный виджет из набора WP, его содержимое изменить нельзя;

все виджеты должны иметь одинаковую структуру.

Необходимо помнить что, в текстовые виджеты, блоки комментариев, формы и т.д. клиент или имплементатор могут добавить дополнительное содержимое (списки, параграфы и др.), при этом стили добавленных элементов должны наследоваться и соответствовать общему дизайну сайта.

Cмотрите общие требования верстки под имплементацию.(General Reset п.4)

Обратите внимание на области отмеченные в инвестигейте как «контент страницы», для этих блоков должны быть как минимум заданы боковые падинги и вертикальный отступ.
Поскольку в этот блок могут быть помещены любое содержимое не только то что указано в дизайне, то задавать эти отступы для конкретных внутренних блоков не правильно.
Так же для всех контентных блоков (сюда относяться и контент поста/статьи), должны быть прописаны стили для след тегов p, ul, ol, a и заголовков даже если их нет в дизайне этого конкретного блока (если только они не заданы болeе глобально):

для h1-h6 – размер, толщина, цвет, семейство шрифта и margin;

для p – margin;

для ul, ol – margin, и стили для буллетов согласно дизайну или если нет дизайна выравниваем кросбраузерно на свой вкус;

для a – цвет (если отличается от глобального).
